import React from 'react';
import { connect } from 'react-redux';
import { Any_Type } from '../../../../actions';

const Details = ({Any_Type, children}) => {

    return(
        <div onClick={() => Any_Type(children)}>
            {children}
        </div>
    )
}
const mapStateToProps = state => {return {count: state}}

export default connect(mapStateToProps, {Any_Type})(Details);
